import React from 'react'

const CatModal = ({active, setActive}) => {
  return (
    <div className='modal' onClick={() => setActive(false)}>
      <div className="modal__content" onClick={e => e.stopPropagation()}></div>
    </div>
  )
}

export default CatModal
